import { initializeApp } from "firebase/app";
import { getAuth, signOut, } from "firebase/auth";
import { useNavigate } from "react-router-dom";
import "./app.css"
function Main() {

    const navigate = useNavigate()

    const firebaseConfig = {
        apiKey: "AIzaSyClEH1wG_p4Bk7y8dl88UEi1OcSmd_7Yl4",
        authDomain: "pro-app-7adb5.firebaseapp.com",
        projectId: "pro-app-7adb5",
        storageBucket: "pro-app-7adb5.appspot.com",
        messagingSenderId: "840528707586",
        appId: "1:840528707586:web:759e54f6d5ecf02251671b",
        measurementId: "G-Q000JTLWD8"
    };

    const app = initializeApp(firebaseConfig);
    const auth = getAuth()
    const submitData = (event) => {
        event.preventDefault()


        signOut(auth)
            .then(() => {
                alert("Logout successfull")
                navigate("/Login")
            })
            .catch(() => {
                alert("error")
            })

    }

    return (


        <div id="nav">
            <div>
                <ul>
                    <li><img src="https://cdn-icons-png.flaticon.com/512/146/146940.png" style={{ width: "70px", borderRadius: "20%" }}></img></li>
                    <li> <b>BOOK STALL</b> </li>
                    <li> <form class="d-flex" role="search">
                        <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search" style={{ width: "400px" }} />
                        <button class="btn btn-outline-success" type="submit">Search</button>
                    </form></li>
                    <li > <i class="fa-solid fa-bell fa-shake" style={{ border: "1px solid black ", borderRadius: "50%", padding: "10px" }}></i></li>
                    <li>  <form id="log" onSubmit={submitData}>
                        <button type="submit" class="btn btn-danger">Logout</button>
                    </form>
                    </li>

                </ul>
            </div>

        </div>







































    )
}
export default Main;
